import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "../Pages/Authentication/Login";
import Dashboard from "../Pages/LandingPage/Dashboard";
import Page from "../components/Page"; // Import the 'Page' component

const Index = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          render={(props) => (
            <Page title="Welcome to ">
              <Login {...props} />
            </Page>
          )}
        />
        <Route
          path="/dashboard"
          render={(props) => (
            <Page title="Welcome to Chemical Ordering Page">
              <Dashboard {...props} />
            </Page>
          )}
        />
      </Routes>
    </BrowserRouter>
  );
};

export default Index;
